import './App.css';
import { Container, Row, Col } from 'react-bootstrap'

function App() {
  return (
    <div className="App">
<Container>
  <Row>
    <Col className="test" md={4}>md=4</Col>
    <Col className="test" md={{ span: 4, offset: 4 }}>{`md={{ span: 4, offset: 4 }}`}</Col>
  </Row>
  <Row>
    <Col className="test" md={{ span: 3, offset: 3 }}>{`md={{ span: 3, offset: 3 }}`}</Col>
    <Col md={{ span: 3, offset: 3 }}>{`md={{ span: 3, offset: 3 }}`}</Col>
  </Row>
  <Row>
    <Col md={{ span: 6, offset: 3 }}>{`md={{ span: 6, offset: 3 }}`}</Col>
  </Row>
</Container>
       {/* <ActivityCard/> */}
    </div>
  );
}

export default App;
